// ==========================
// 工具函数
// ==========================
function initMapChart() {
  const el = document.getElementById('map-container');
  if (!el) return;
  // 彻底销毁旧实例，保证无残留轴
  if (window.MapChart && !window.MapChart.isDisposed()) window.MapChart.dispose();
  window.MapChart = echarts.init(el);
  loadMapData();
}

function loadMapData() {
  if (!window.MapChart) return;
  window.MapChart.showLoading();
  fetch('./JSON/world.json')
    .then(r => r.json())
    .then(j => {
      echarts.registerMap('world', j);
      renderCharts();
    })
    .catch(() => {
      echarts.registerMap('world', { type: 'FeatureCollection', features: [] });
      renderCharts();
    });
}

function renderCharts() {
  const el = document.getElementById('map-container');
  if (!el) return;

  // 彻底销毁旧实例
  if (window.MapChart && !window.MapChart.isDisposed()) window.MapChart.dispose();
  window.MapChart = echarts.init(el);

  // ✅ 关键：先清空配置
  window.MapChart.setOption({}, true);
  window.MapChart.clear();

  if (isShowingLineChart) renderLineChart();
  else {
    currentYearIndex = 0;
    renderMapAndBarChart();
  }
}
