// ==========================
// 中国折线图
// ==========================
function renderLineChart() {
  const opt = {
    title: { text: '中国精神健康疾病患病率趋势(2000-2017)', left: 'center',textStyle:{fontFamily:'SimSum, 宋体, sams-serif',fontSize:20}  },
    tooltip: { trigger: 'axis' },
    legend: {
      data: ['Schizophrenia', 'Bipolar', 'EatingDisorders', 'Anxiety', 'Depression', 'AlcoholUse'],
      top: 50, right: 30
    },
    grid: { left: '3%', right: '4%', bottom: '3%', top: '20%', containLabel: true },
    xAxis: { type: 'category', data: chinaLineData.years },
    yAxis: { type: 'value', axisLabel: { formatter: '{value}%' } },
    series: ['Schizophrenia', 'Bipolar', 'EatingDisorders', 'Anxiety', 'Depression', 'AlcoholUse'].map(
      (name, i) => ({
        name,
        type: 'line',
        smooth: true,
        data: chinaLineData[name],
        itemStyle: { color: COLOR.line[i] }
      })
    )
  };
  window.MapChart.setOption(opt, true);
}

// ==========================
// 事件 & 启动
// ==========================
function bindEvents() {
  const selector = document.getElementById('disease-selector');
  const toggleBtn = document.getElementById('toggle-chart');
  const pauseBtn = document.getElementById('pause-animation');

  selector?.addEventListener('change', () => {
    currentDisease = selector.value;
    currentYearIndex = 0;
    if (animationInterval) clearInterval(animationInterval);
    renderCharts();
  });

  toggleBtn?.addEventListener('click', () => {
    isShowingLineChart = !isShowingLineChart;
    toggleBtn.textContent = isShowingLineChart ? '切换世界地图' : '切换中国折线图';
    if (animationInterval) clearInterval(animationInterval);
    renderCharts();
  });

  pauseBtn?.addEventListener('click', () => {
    isAnimationPaused = !isAnimationPaused;
    pauseBtn.textContent = isAnimationPaused ? '继续动画' : '暂停动画';
  });
}

document.addEventListener('DOMContentLoaded', () => {
  initMapChart();
  bindEvents();
});

window.addEventListener('resize', () => {
  window.MapChart && window.MapChart.resize();
});